import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import LoginPage from "./pages/LoginPage";
import SignupPage from "./pages/SignupPage";
import HomePage from "./pages/Home";
import MapPage from "./pages/MapPage";
import NatureCulturePage from "./pages/NatureCulture";
import EstablishmentsPage from "./pages/Establishments";
import ProfilePage from "./pages/profile";
import Navbar from "./components/NavBar";
import RouteDetails from "./pages/RouteDetails";

import AdminDashboard from "./pages/admin/AdminDashboard";
import AdminPOIs from "./pages/admin/AdminPOIs";
import AdminUsers from "./pages/admin/AdminUsers";
import AdminPreferences from "./pages/admin/AdminPreferences";
import AdminML from "./pages/admin/AdminML";
import AdminReports from "./pages/admin/AdminReports";

export default function App() {
  const [user, setUser] = useState(null);

  // Check localStorage on app load
  useEffect(() => {
    const storedUser = localStorage.getItem("user");
    if (storedUser) setUser(JSON.parse(storedUser));
  }, []);

  const isAdmin = user?.role === "admin";

  // Automatically redirect based on role if already logged in
  const DefaultRedirect = () => {
    if (!user) return <Navigate to="/login" />;
    return isAdmin ? <Navigate to="/admin/dashboard" /> : <Navigate to="/home" />;
  };

  return (
    <Router>
      {user && <Navbar />}
      <Routes>
        <Route path="/" element={<DefaultRedirect />} />

        {/* Public routes */}
        <Route path="/login" element={user ? <DefaultRedirect /> : <LoginPage setUser={setUser} />} />
        <Route path="/signup" element={user ? <DefaultRedirect /> : <SignupPage />} />

        {/* User routes */}
        <Route path="/home" element={user ? <HomePage /> : <Navigate to="/login" />} />
        <Route path="/mappage" element={user ? <MapPage /> : <Navigate to="/login" />} />
        <Route path="/natureculture" element={user ? <NatureCulturePage /> : <Navigate to="/login" />} />
        <Route path="/establishments" element={user ? <EstablishmentsPage /> : <Navigate to="/login" />} />
        <Route path="/profile" element={user ? <ProfilePage /> : <Navigate to="/login" />} />
        <Route path="/routedetails" element={<RouteDetails />} />

        {/* Admin routes */}
        <Route path="/admin/dashboard" element={isAdmin ? <AdminDashboard /> : <Navigate to="/login" />} />
        <Route path="/admin/pois" element={isAdmin ? <AdminPOIs /> : <Navigate to="/login" />} />
        <Route path="/admin/users" element={isAdmin ? <AdminUsers /> : <Navigate to="/login" />} />
        <Route path="/admin/preferences" element={isAdmin ? <AdminPreferences /> : <Navigate to="/login" />} />
        <Route path="/admin/ml" element={isAdmin ? <AdminML /> : <Navigate to="/login" />} />
        <Route path="/admin/reports" element={isAdmin ? <AdminReports /> : <Navigate to="/login" />} />
      </Routes>
    </Router>
  );
}
